import { useNavigate } from "react-router-dom";

const Home = () => {
  const navigate = useNavigate();

  return (
    <div className="container text-center mt-5">
      <h1 className="brand-gradient fw-bold mb-3">
        Climate Intelligence Platform
      </h1>

      <p className="mb-4">
        Secure access to Climatrix Sri Lanka services
      </p>

      <button
        className="btn btn-green-custom px-4 py-2"
        onClick={() => navigate("/login")}
      >
        Click Here
      </button>
    </div>
  );
};

export default Home;
